import React ,{useState, useEffect} from 'react';
import {
  ChakraProvider,
  Box,
  theme,
  Tabs,
  TabList,
  TabPanels,
  Tab,
  TabPanel,
} from '@chakra-ui/react';
import Header from './components/header'
import Prototype_Single from './components/prototype_single_page';
import Prototype from './components/prototype';
import Prototype_Single_simple from './components/prototype_single_simple';



function App() {

  const [width, setWidth] = useState();

  useEffect(() => {
    setWidth(window.innerWidth)
    console.log(width)
  })
  return (
    <ChakraProvider theme={theme}>
      <Header w="100%"/>
        <Tabs isFitted isLazy>
          <TabList mb="1em">
            <Tab>KLIA</Tab>
            <Tab>klia2</Tab>
          </TabList>
          <TabPanels>
            <TabPanel>
              {width > '768' ? <Prototype_Single /> : <Prototype />}
            </TabPanel>
            <TabPanel>
            {width > '768' ? <Prototype_Single /> : <Prototype />}
            </TabPanel>
          </TabPanels>
        </Tabs>
    </ChakraProvider>
  );
}

export default App;
